import React from 'react'
import BasePageWithCard from './BasePageWithCard';
import CreateScheduleProtectionForm from '../components/Forms/CreateScheduleProtectionForm/CreateScheduleProtectionForm';

function CreateSheduleProtection({secretaryData, groups_for_schedule}) {
  return (
    <BasePageWithCard isAuthenticated={true} data={secretaryData} groups_for_schedule={groups_for_schedule}>
<CreateScheduleProtectionForm/>
          </BasePageWithCard>
  )
}

export default CreateSheduleProtection
